import React from "react";

const NavBar = props => {
  return (
    <nav className="navbar navbar-light bg-light">
      <ul class="nav navbar-nav navbar-right">
        <li class="app-user navbar-text" />
        <li>
          <a href="#" class="app-logout">
            Logout
          </a>
        </li>
        <li>
          <a href="javascript:;" class="app-login">
            Login
          </a>
        </li>
      </ul>
    </nav>
  );
};
export default NavBar;
